import Vue from 'vue'
import App from './App.vue'
// 引入router配置文件
import VueRouter from 'vue-router'
import router from '@/router'
// 引入element UI

import { Button, FormItem, Form, Select, Option } from 'element-ui';
import 'element-ui/lib/theme-chalk/index.css';
import "./assets/global.css"


Vue.config.productionTip = false

Vue.use(VueRouter)
Vue.use(Button)
Vue.use(FormItem)
Vue.use(Form)
Vue.use(Select)
Vue.use(Option)


new Vue({
  router,
  render: h => h(App),
}).$mount('#app')
